import maison1 from './assets/images/maison1.jpg';
import maison2 from './assets/images/maison2.jpeg';
import maison3 from './assets/images/maison3.jpeg';

function Pictures({pictures}) {
    return(
        <div>

            <div>
                <img src={pictures.maison1} alt="Maison 1" />;
                <img src={pictures.maison2} alt="Maison 2" />;
                <img src={pictures.maison3} alt="Maison 3" />;
            </div>

        </div>
    )
}

export default Pictures;
